let state = {
    posts: [
        {id: "1", message: "How are you", like:"23"},
        {id: "2", message: "My first message", like:"47"}
    ],
    dialogs: [
        {name: "Dimon", id: "1"},
        {name: "Romu4", id: "2"},
        {name: "Nazar", id: "3"},
        {name: "Nastya", id: "4"},
        {name: "Ira", id: "5"}
    ],
    messages: [
        {id: "1", text: "How are you"},
        {id: "2", text: "How is your it-kamasutra?"},
        {id: "3", text: "I like it"},
        {id: "4", text: "Me too!!!!"},
        {id: "5", text: "Have a nice day!)"},
    ]
}

export default state;
